import { DOMParser } from 'xmldom';

function convertXmlToMarkdown(xmlString) {
    const parser = new DOMParser();
    const xmlDoc = parser.parseFromString(decodeURIComponent(xmlString), "text/xml");

    // Find the table title
    const tableTitleCell = xmlDoc.getElementsByTagName('mxCell')[2]; // Adjust index as needed
    const tableTitle = tableTitleCell ? tableTitleCell.getAttribute('value') : "Table";

    // Find the column headers
    const columnHeaderCells = Array.from(xmlDoc.getElementsByTagName('mxCell')).filter(cell => cell.getAttribute('parent') === "3");
    const columnHeaders = columnHeaderCells.map(cell => cell.getAttribute('value') || '');

    // Find all rows dynamically
    const rowParents = Array.from(xmlDoc.getElementsByTagName('mxCell')).filter(cell => {
        const style = cell.getAttribute('style');
        return style && style.includes('tableRow');
    });
    const rows = rowParents.map(rowParent => {
        const rowCells = Array.from(xmlDoc.getElementsByTagName('mxCell')).filter(cell => cell.getAttribute('parent') === rowParent.getAttribute('id'));
        return columnHeaders.map((_, index) => {
            const cell = rowCells[index];
            return cell ? cell.getAttribute('value') || '' : '';
        });
    });

    // Build the Markdown table
    let markdown = `# ${tableTitle}\n\n`;
    markdown += `| ${columnHeaders.join(' | ')} |\n`;
    markdown += `| ${columnHeaders.map(() => '---').join(' | ')} |\n`;

    rows.forEach(row => {
        markdown += `| ${row.join(' | ')} |\n`;
    });

    return markdown;
}

function saveMarkdownToFile(markdown, outputFolder, fileName) {
    const outputPath = join(outputFolder, fileName);
    mkdirSync(outputFolder, { recursive: true });
    writeFileSync(outputPath, markdown, 'utf8');
    console.log(`Markdown file saved to: ${outputPath}`);
}


